import React, { Component } from 'react';
import styles from '../navbar/navbar.module.scss';

export default class Navbar extends Component {
  render() {
    return(
      <nav className={(styles.nav, styles.dFlex)}>
        <a className={styles.brand, styles.link} href=""><img className={styles.logo} src="" alt="" />LOGO</a>
        <ul className={styles.menu, styles.dFlex}>
          <li className={styles.item}><a className={styles.link, styles.btn} href="">Log In</a></li>
          <li className={styles.item}><a className={styles.link} href="">Sign Up</a></li>
        </ul>
      </nav>
    );
  }
}
